import React, { useEffect, useState } from 'react';

function ProductRegistration() {
  const [productName, setProductName] = useState('');
  const [productPrice, setProductPrice] = useState('');
  const [productBarcode, setProductBarcode] = useState('');
  const [productDescription, setProductDescription] = useState('');
  const [productImage, setProductImage] = useState(null);
  const [products, setProducts] = useState([]);
  const [productDiscount, setProductDiscount] = useState('');
  const [productExpiration, setProductExpiration] = useState('');
  const [finalPrice, setFinalPrice] = useState('');
  const [submittedProduct, setSubmittedProduct] = useState('');

  useEffect(() => {
    const storedProducts = JSON.parse(localStorage.getItem('products'));
    if (storedProducts) {
      setProducts(storedProducts);
    }
  }, []);

  const saveProductsToLocalStorage = (updatedProducts) => {
    localStorage.setItem('products', JSON.stringify(updatedProducts));
  };

  const handleProductRegistration = (e) => {
    e.preventDefault();

    const newProduct = {
      name: productName,
      price: productPrice,
      barcode: productBarcode,
      description: productDescription,
      image: productImage,
      discount: productDiscount,
      expiration: productExpiration,
      finalPrice: finalPrice,
    };

    const updatedProducts = [...products, newProduct];
    setProducts(updatedProducts);
    saveProductsToLocalStorage(updatedProducts);

    setSubmittedProduct(newProduct);

    setProductName('');
    setProductPrice('');
    setProductBarcode('');
    setProductDescription('');
    setProductImage('');
    setProductDiscount('');
    setProductExpiration('');
    setFinalPrice('');
  };

  const handleImageChange = (e) => {
    const selectedImage = e.target.files[0];
    setProductImage(URL.createObjectURL(selectedImage));
  };

  const handleCancel = () => {
    window.location.href = '/shop';
  };

  const handleConfirm = () => {
    window.location.href = '/shop';
  };

  return (
    <>
      {/* 상품 등록 폼 */}
      <form onSubmit={handleProductRegistration}>
        {/* 입력 폼들 */}
      </form>

      {/* 등록한 상품 정보 표시 */}
      <div className="container-fluid mt-5">
        <h2 className="text-center mb-4">등록한 상품 정보</h2>
        <div className="row justify-content-center">
          <div className="col-lg-8">
            <div className="border p-4">
              <h4>상품명: {submittedProduct.name}</h4>
              <p>정가: {submittedProduct.price}</p>
              <p>할인율: {submittedProduct.discount}</p>
              <p>바코드 번호: {submittedProduct.barcode}</p>
              <p>유효기간: {submittedProduct.expiration}</p>
              <p>설명: {submittedProduct.description}</p>
              <p>판매금액: {submittedProduct.finalPrice}</p>
              <img
                src={submittedProduct.image ? submittedProduct.image : "img/sale.png"}
                alt="Product"
                className="img-fluid mt-3"
                style={{ maxWidth: '100%', maxHeight: '300px', objectFit: 'cover' }}
              />
            </div>
          </div>
        </div>
      </div>

      {/* 확인 및 취소 버튼 */}
      <div className="row g-4 text-center align-items-center justify-content-center pt-4">
        <button
          type="submit"
          className="btn border-secondary py-3 px-4 text-uppercase text-primary"
          style={{ marginBottom: '40px', width: '6%' }}
          onClick={handleConfirm}
        >
          확인
        </button>
        <button
          type="submit"
          className="btn border-primary py-3 px-4 text-uppercase text-primary"
          style={{ marginLeft: '20px', marginBottom: '40px', width: '6%' }}
          onClick={handleCancel}
        >
          취소
        </button>
      </div>
    </>
  );
}

export default ProductRegistration;
